    /**
     * Transforms unit
     *
     * @access public
     * @param mixed $from default as pt. Allowed units: cm, emu, in, pt, px
     * @param mixed $to default as pt. Allowed units: cm, emu, in, pt, px
     * @static
     * @return int|float
     */
    public static function transformUnits($from, $to = 'pt')
    {
        // normalize from values
        $from = str_replace(' ', '', $from); // clean blank spaces
        $from = strtolower($from); // lowercase

        // get values and units
        preg_match('/(\d*(?:\.\d+)?)(cm|emu|in|pt|px)/', $from, $matches);

        if (isset($matches[1])) {
            $fromValue = (float)$matches[1];
        } else {
            // default value
            $fromValue = (float)$from;
        }
        if (isset($matches[2])) {
            $fromUnit = $matches[2];
        } else {
            $fromUnit = 'pt';
        }

        // transform to emus the from value
        switch ($fromUnit) {
            case 'cm':
            case 'cms':
                $fromValueEmus = $fromValue * 360000;
                break;
            case 'in':
            case 'inches':
                $fromValueEmus = $fromValue * 914400;
                break;
            case 'px':
                $fromValueEmus = ($fromValue * 12700) / 1.33;
                break;
            case 'emu':
            case 'emus':
                $fromValueEmus = $fromValue;
                break;
            case 'pt':
            default:
                $fromValueEmus = $fromValue * 12700;
                break;
        }

        // transform emus to the target unit
        switch ($to) {
            case 'cm':
            case 'cms':
                $toValue = $fromValueEmus / 360000;
                break;
            case 'emu':
            case 'emus':
                $toValue = $fromValueEmus;
                break;
            case 'in':
            case 'inches':
                $toValue = $fromValueEmus / 914400;
                break;
            case 'px':
                $toValue = $fromValueEmus / (12700 * 1.33);
                break;
            case 'pt':
            default:
                $toValue = $fromValueEmus / 12700;
                break;
        }

        return $toValue;
    }
